import axios from "axios";

export const getEvents = async () => {
  try {
    const {
      data: { data },
    } = await axios.get(
      `https://localhost:7010/User/all`,
      {
        headers: {
          "X-RapidAPI-Key": "ea9d745207msh8cd03420e084d49p1ac50ajsn5f5967a56706",
          "X-RapidAPI-Host": "travel-advisor.p.rapidapi.com",
        },
      }
    );

    return data;
  } catch (error) {
    return null;
  }
};
